import React from "react";
import "../Search/Search.css";

const Search = () => {
  return (
    <>
      <section className="search-container">
        <div className="max-width-container">
          <input
            className="search-bar"
            type="text"
            placeholder="Search for movies or TV series"
          />
        </div>
      </section>
    </>
  );
};

export default Search;
